import React from "react";
import { Button,Container } from "reactstrap";


function Home(){
    return (
      <div class="container-fluid text-center bg-secondary text-dark p-5">
        <div class="container bg-light p-5">
          <h1 class="display-4 fw-bold">Welcome to Admin Dashboard</h1>
          <Container>
            <p>Go to My Website</p>
            <Button color="primary" outline> Let's Study</Button>
          </Container>
        </div>
      </div>
    );
}

export default Home;
